        public static double GetCriticalValue(int firstFreedomDegree, int secondFreedomDegree, double significanceLevel)
        {
            if (!_distributionTables.ContainsKey(significanceLevel))
            {
                throw new Exception($"There is not a distribution table for significance level = {significanceLevel}! Use 0.05, 0.001 instead.");
            }

            var distributionTable = _distributionTables[significanceLevel];

            for (int i = 0; i < distributionTable.Count; i += 32)
            {
                if (firstFreedomDegree <= distributionTable[i].FirstFreedomDegree)
                {
                    for (int j = 0; j < 32; j++)
                    {
                        if (secondFreedomDegree <= distributionTable[i + j].SecondFreedomDegree)
                        {
                            return distributionTable[i + j].Value;
                        }
                    }
                }
            }

            throw new Exception($"There is not a value for the freedom degrees: {firstFreedomDegree} and {secondFreedomDegree}!");
        }

        private struct DistributionTriplet
        {
            public int FirstFreedomDegree { get; set; }
            public int SecondFreedomDegree { get; set; }
            public double Value { get; set; }
        }
    }
